import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="profile-card">
        <img
          src="https://via.placeholder.com/150"
          alt="Profile"
          className="profile-image"
        />
        <h1 className="profile-name">Kamylla da Silva Santos</h1>
        <p className="profile-course">Curso: Análise e Desenvolvimento de Sistemas</p>
        <p className="profile-bio">
          Estudante apaixonada por tecnologia e programação, sempre buscando novos desafios e
          conhecimentos para se desenvolver na área de TI.
        </p>
      </div>
    </div>
  );
}

